import React from 'react';
import './Header.scss';
import logo from '../../assets/logo/inStock-logo.svg'


const header = () => {
  return (
    <header className="header">
        <img className="header__logo" src={logo} alt="logo" />
      <div className="header__wrapper">
      <NavLink to="/warehouses"
      activeStyle={{backgroundColor: "#13182C",color: "white"}} ><button className="header__btn">Warehouses</button></NavLink>
      <NavLink to="/warehouses"
      activeStyle={{fontWeight:"bold",color: "red"}} ><button className="header__btn">Inventory</button></NavLink>
      </div>
    </header>
  );
};

export default header;
